import { Empresa, StatusExtrato, MesesData, ObrigacoesData, Socio, DadosMensais, ControleObrigacoes, RegimeTributario } from "@/types/fiscal";

const emptyMes = (): DadosMensais => ({
  extratoEnviado: "nao" as StatusExtrato,
  faturamentoNacional: 0,
  faturamentoNotaFiscal: 0,
  faturamentoExterior: 0,
  faturamentoAlugueis: 0,
  faturamentoTotal: 0,
  distribuicaoLucros: 0,
  lancadoQuestor: "pendente",
});

const createEmptyMeses = (): MesesData => ({
  janeiro: emptyMes(), fevereiro: emptyMes(), marco: emptyMes(),
  abril: emptyMes(), maio: emptyMes(), junho: emptyMes(),
  julho: emptyMes(), agosto: emptyMes(), setembro: emptyMes(),
  outubro: emptyMes(), novembro: emptyMes(), dezembro: emptyMes(),
});

const emptyObrigacoes = (): ControleObrigacoes => ({
  lancamentoFiscal: "pendente", reinf: "pendente", dcftWeb: "pendente", mit: "pendente",
});

const createEmptyObrigacoes = (): ObrigacoesData => ({
  marco: emptyObrigacoes(), junho: emptyObrigacoes(), setembro: emptyObrigacoes(), dezembro: emptyObrigacoes(),
});

function e(n: number, nome: string, cnpj: string, dt: string, nf: boolean, socios: Socio[]): Empresa {
  return {
    id: crypto.randomUUID(), numero: n, nome, cnpj, inicioCompetencia: dt,
    dataCadastro: "2026-01-01",
    regimeTributario: "simples_nacional", emiteNotaFiscal: nf, socios,
    meses: createEmptyMeses(), obrigacoes: createEmptyObrigacoes(),
  };
}

// CPF values in calls below are placeholders and NOT used — real PII has been removed.
let _extraCpfIdx = 10000;
function s(nome: string, pct: number, _cpf?: string): Socio {
  _extraCpfIdx++;
  const n = String(_extraCpfIdx).padStart(9, '0');
  return { nome, percentual: pct, cpf: `${n.slice(0, 3)}.${n.slice(3, 6)}.${n.slice(6, 9)}-00` };
}

